import React from 'react';
import './template.css'
const Template = () => {
  return <>
        <div className="SubmitButtondiv">
            <button className="SubmitButton">Submit</button>
        </div>
        <div>
            <div className="top-image">
            <img src='/images/template1.jpg' height="600px" width="100%"  > 
            </img>
            </div>
        </div>

  </>;
};

export default Template;
